import {Container,Nav,Navbar,Row,Col} from 'react-bootstrap';
import './App.css';
import { useState } from 'react';
import data from './data.js';

function App() {

  let [modal,setModal]=useState(false);
  let [shoes]=useState(data);
  return (   

    <div className="App">

      <Navbar className="Header" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <body className="Body">
        <h4>OUTWEAR</h4> 
        <hr></hr>
        <button onClick={()=>setModal(!modal)} aria-expanded="false" aria-controls="refinement-wrap">Filters &amp; sort by<i></i></button>
        {modal==true?<Modal></Modal>:null}
        <hr></hr>
        <button className="Tag">태그 X</button>

        <Container>
          <Row>
            <Col><div className="Item">
              <img src="https://codingapple1.github.io/shop/shoes1.jpg" width="80%"/>
              <h4>{shoes[0].title}</h4>
              <p>{shoes[0].price}</p>
              </div></Col>
            <Col className='Itemimg'>2</Col>
            <Col><itemCard></itemCard></Col>
          </Row>
          <Row>
            <Col>4</Col>
            <Col>5</Col>
            <Col>6</Col>
          </Row>
        </Container>
      </body>

    </div>
  );
}

function Modal(){
  return(
    <div className="Modal">
      <p>스타일 선택</p>
      <p>색상 선택</p>
      <p>sort</p>
    </div>
  )
}

function itemCard(props){
  <div className="Item">
              <img src="https://codingapple1.github.io/shop/shoes1.jpg" width="80%"/>
              <h4>{props.shoes[0].title}</h4>
              <p>{props.shoes[0].price}</p>
              </div>
}
export default App;
